export const siteData = {
  "title": "Netlify CMS + VuePress",
  "description": "Netlify + VuePress",
  "base": "/",
  "pages": [
    {
      "path": "/",
      "title": "Home",
      "frontmatter": {
        "home": true,
        "heroImage": "/images/vuejsradar.png",
        "actionText": "Try it Out →",
        "actionLink": "/welcome",
        "features": [
          {
            "title": "Markdown Editing",
            "details": "Netlify's CMS provides a flexible Markdown Editor"
          },
          {
            "title": "Asset Management",
            "details": "Easily upload images to your repo with an uploader"
          },
          {
            "title": "Powerful Deployments",
            "details": "Leverage the power of netlify and VuePress to deploy statically"
          }
        ],
        "footer": "MIT Licensed | Copyright © 2018-present Andre Liem (www.vuejsradar.com)",
        "title": "FRONT PAGE"
      }
    },
    {
      "path": "/test.html",
      "title": "My First Netlify Post",
      "frontmatter": {
        "title": "My First Netlify Post"
      }
    },
    {
      "path": "/welcome.html",
      "title": "Welcome to the VuePress + Netlify Example",
      "frontmatter": {
        "title": "Welcome to the VuePress + Netlify Example"
      }
    }
  ],
  "themeConfig": {
    "docsDir": "docs",
    "repo": "andreliem/vuepress-netlify-cms",
    "sidebar": [
      "/",
      "/welcome",
      "/test"
    ],
    "nav": [
      {
        "text": "Admin",
        "link": "/admin/#/"
      }
    ]
  }
}
